/*
* SP = saturated by pressure
* ST = saturated by temperature
* CLSS = condensed liquid and superheated steam
*/

function get_constant_enthalpy() {
  for(let H = 500; H < 5000; H += 500) {
    const coordinates = [];
    const pressures = [];
    const indexes_of_pressure = []; // the array index
    for(let i = 0; i < CLSS.length; i++) {
      const props = CLSS[i];
      const current_pressure = pressures[pressures.length - 1] || 0;
      if(props[0] != current_pressure && current_pressure < 100) {
        indexes_of_pressure.push(i);
        pressures.push(props[0]);
      }
    }
    for(let i = 0; i < indexes_of_pressure.length; i++) {
      const start_index = indexes_of_pressure[i];
      const end_index = indexes_of_pressure[i + 1] || CLSS.length - 1;
      const pressure = CLSS[start_index][0];
      for(let index = start_index; index < end_index - 1; index++) {
        const props_low = CLSS[index];
        const props_high = CLSS[index + 1];
        const H_low = props_low[5];
        const H_high = props_high[5];
        let is_100_yet;
        if(coordinates.length != 0) {
          is_100_yet = coordinates[coordinates.length - 1][1];
        } else {
          is_100_yet = 0;
        }
        if(H_low <= H && H_high >= H && is_100_yet != 100) {
          const diff = (H - H_low) / (H_high - H_low);
          const P = pressure;
          const V_low = props_low[2];
          const V_high = props_high[2];
          const V = props_low[2] + diff * (V_high - V_low);
          coordinates.push([V, P]);
        }
      }
    }
    window.constant_enthalpy_lines.push(coordinates);
  }
}

function get_constant_entropy() {
  for(let S = 1; S < 9; S += 1) {
    const coordinates = [];
    const pressures = [];
    const indexes_of_pressure = []; // the array index
    for(let i = 0; i < CLSS.length; i++) {
      const props = CLSS[i];
      const current_pressure = pressures[pressures.length - 1] || 0;
      if(props[0] != current_pressure && current_pressure < 100) {
        indexes_of_pressure.push(i);
        pressures.push(props[0]);
      }
    }
    for(let i = 0; i < indexes_of_pressure.length; i++) {
      const start_index = indexes_of_pressure[i];
      const end_index = indexes_of_pressure[i + 1] || CLSS.length - 1;
      const pressure = CLSS[start_index][0];
      for(let index = start_index; index < end_index - 1; index++) {
        const props_low = CLSS[index];
        const props_high = CLSS[index + 1];
        const S_low = props_low[6];
        const S_high = props_high[6];
        let is_100_yet;
        if(coordinates.length != 0) {
          is_100_yet = coordinates[coordinates.length - 1][1];
        } else {
          is_100_yet = 0;
        }
        if(S_low <= S && S_high >= S && is_100_yet != 100) {
          const diff = (S - S_low) / (S_high - S_low);
          const P = pressure;
          const V_low = props_low[2];
          const V_high = props_high[2];
          const V = props_low[2] + diff * (V_high - V_low);
          coordinates.push([V, P]);
        }
      }
    }
    window.constant_entropy_lines.push(coordinates);
  }
}

function get_constant_quality() {
  for(let q = 0.01; q <= 1.0; q += 0.01) {
    if(q == 1.0) {
      q = 0.999
    }
    q = Number(q.toFixed(3));
    const coordinates = [];
    for(let i = 0; i < SP.length; i++) {
      const props = SP[i];
      const P = props[0];
      if(P >= 0.01) {
        const V_liq = props[13];
        const V_vap = props[14];
        const V = q * V_liq + (1 - q) * V_vap;
        coordinates.push([V, P]);
      }
    }
    if(coordinates.length > 0) {
      window.constant_quality_lines.push(coordinates);
    }
  }
}